import React from 'react'
import HomeCarousel from './homeCarousel/homeCarousel'

const images = ["/public/images/DrouotHome2.jpg","/public/images/DrouotHome2.jpg"]

const Home = () => {

    return(
        <div className="text-center">
        <h1>Home</h1>
        <HomeCarousel images={images}/>
        </div>
    )
}

export default Home
